from timeit import default_timer as timer

def reverse_complement(s: str) -> str:
    complements = {'A': 'T', 'T': 'A', 'C': 'G', 'G': 'C'}
    s_c = ''.join(complements[char] for char in reversed(s))    
    return s_c

s = ''
start = timer()
print(reverse_complement(s))
end = timer()
print(end - start)